INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(279384, 'deDE', 'Abrisswettkampf des Lorenbosses', 'Abrisswettkampf des Lorenbosses', 59888),
(279845, 'deDE', 'Nein...', '', 59888),
(275804, 'deDE', 'Habt Ihr eine Ahnung, wie teuer das Ding ist? Das bezahlt Ihr mir mit Eurer grünen Haut, Gazlowe!', '', 59888),
(268880, 'deDE', 'Den Käpt\'n so zu sehen... und all den Plunder, den Gallywix ihm anbietet... Da werd ich ganz wild!', '', 59888),
(271175, 'deDE', '', 'Aber ich hatte gerade Spaß...', 59888),
(271159, 'deDE', '', 'Mein Ausführungsmodul! Ich mache mit Euch dasselbe wie mit Renzik!', 59888),
(268888, 'deDE', 'Das Boss Gallywix sein Schwarzblut!', '', 59888),
(268887, 'deDE', 'Wir nehmen Euch jetzt Eure Ladung ab!', '', 59888),
(275706, 'deDE', 'Schüttelt Euch aus!', '', 59888),
(275703, 'deDE', 'Wie weit kann man Fleisch erhitzen, bevor es brutzelt?', '', 59888),
(275100, 'deDE', 'Ich bin dran! Ich zermalme sie.', '', 59888),
(275029, 'deDE', 'Ich zermatsche Euch!', '', 59888),
(274595, 'deDE', 'Viel Geld, große Preise!', '', 59888),
(275947, 'deDE', 'Ich bin der letzte Boss für Euch.', '', 59888),
(275944, 'deDE', 'Ihr SCHULDET mir das!', '', 59888),
(275943, 'deDE', 'Hey! Rein da!', '', 59888),
(282252, 'deDE', 'Rennraser, Euer Ehren. Pflichtverteidiger Rennraser.', '', 59888),
(282250, 'deDE', 'Es ist wahr, Euer Ehren. Wenn Ihr erlaubt, würde ich Euch gerne die kontextrelevante Geschichte dieses Gesetzes...', '', 59888),
(282246, 'deDE', 'Euer Ehren. Tatsächlich hat das Garbagio einen Besitzer.', '', 59888),
(282244, 'deDE', 'Ganz einfach, Euer Ehren. Der Besitzer ist tot. Es MUSS in unserem angesehenen Auktionshaus versteigert werden!', '', 59888),
(281492, 'deDE', 'Und Marty Rennraser ist bereit. Das ist alles, Euer Ehren.', '', 59888),
(281491, 'deDE', 'Tarbonara Knisterkurbel ist bereit und willig und respektvoll bescheiden, Euer Ehren.', '', 59888),
(276966, 'deDE', 'Er hat außerdem Bombenkrabben im ganzen Gerichtssaal versteckt, Euer Ehren. $p hat sie entschärft.', '', 59888),
(276963, 'deDE', 'Euer Ehren, es liegt auf der Hand! Der Mörder kann niemand anders ein als... $p!', '', 59888),
(276962, 'deDE', 'Euer Ehren. Wir haben soeben Beweise erhalten, dass der Mörder von Rosenknospe Gallywix heute im Gerichtssaal anwesend ist!', '', 59888),
(280948, 'deDE', '', 'Knurrt Euch der Magen? Wie wär\'s mit einem Torq zum Mitnehmen? Das ist das beste Erinnerungsstück, das man für Gold kriegen kann! Und *dieses* hier kann nicht mal Abenteurer zerquetschen oder kleine Geschäfte ruinieren!\n\nDas war in der Vergangenheit leider öfter ein Problem...', 59888),
(280946, 'deDE', 'Ich arbeite noch an den Fehlern... Das ganze Revolutionsgedöns überstimuliert mich etwas.\n\nWie wär\'s, wenn Ihr mal den Gesichtsstraffer von Schleifer ausprobiert? Der macht Euch nicht nur so gut wie neu, sondern sogar noch besser!', '', 59888),
(280940, 'deDE', 'Na sieh mal einer an... Ihr wollt bei meiner Operation mitmischen? Tut mir leid, niemand gibt sich je mit nur einem Stück zufrieden. Sorgt erstmal für einen dickeren Geldbeutel, dann könnt Ihr vielleicht mit jemandem wie mir Geschäfte machen.', '', 59888),
(280939, 'deDE', 'Die Rezeption hat grade den Boss angerufen, meinte, Ihr und Eure Kumpels könnt direkt durchmarschieren. Insofern Ihr... erfahren genug seid. Wisst Ihr was? Wieso zeigt Ihr mir nicht, dass Ihr das Zeug habt, Mug\'Zee eins auszuwischen, dann bring ich Euch jederzeit zu den Hinterzimmern.\n\nEure Treue bedeutet uns im Garbagio sehr viel. *Selbst wenn* Ihr den Laden auseinandernehmt!', '', 59888),
(280933, 'deDE', 'Der Boss sagt, ich soll Fremden nix von unseren gefälschten Waffen erzählen, weil sie ja nicht echt sind. Ist einfacher, sie an Touristen zu verhökern, die denken, sie WÄREN echt.\n\nAlso erzählt das keinem. *Besonders* nicht Fremden.', '', 59888),
(280080, 'deDE', '<Wütendes Schreien>', '', 59888),
(279822, 'deDE', '', 'Wir sehen uns wieder, Gazzy.', 59888),
(275813, 'deDE', 'Jemand wird stinkig. Wollt Ihr mich ausbooten? Macht nur weiter. Wir sehen uns noch.', '', 59888),
(275810, 'deDE', 'Und Ihr habt keine Genehmigung! Oder, Mug?', '', 59888),
(275777, 'deDE', 'Heureka! Gallywix wird sich vor Freude überschlagen, wenn er das sieht! Oder auch nicht. Vielleicht wäre erst eine Marktumfrage angebracht.', '', 59888),
(275363, 'deDE', '', 'Jetzt ist Schluss!', 59888),
(275239, 'deDE', 'Wir sind gleich zurück nach diesen, äh... Nachrichten!', '', 59888);
