(2640, 'deDE', 'Kessel des Gemetzels', 'Im Lauf der Geschichte kam es zu vielen epischen Schlachten, doch keine davon war auch nur annähernd so explosiv wie die Rivalität zwischen dem galvanischen Gorilla Torq dem Tobenden und dem geschmolzenen Mechasaurus Leuchtendo dem Lodernden. Heute Nacht ist alles möglich, wenn diese beiden Champions im Kessel für einen Showdown aufeinandertreffen, der droht, Lorenhall in Stücke zu reißen! Werdet Zeuge des Gemetzels oder erntet den Spott aller Goblins.', 59888);
