(30108, 'deDE', 'Verstreute Auszahlung', '', 59888),
(31438, 'deDE', 'Abschnitt 29', '', 59888),
(30331, 'deDE', 'Zusammenfassung', 'Leuchtendo und Torq veranstalten ein Spektakel für das Publikum, indem sie |cFF2959D3|Hspell:473650|h[Schrottbomben]|h|r werfen und die Arenakämpfer mit |cFF2959D3|Hspell:473951|h[Statischen Aufladungen]|h|r belegen.\nBei Erreichen von 100 Energie treffen Leuchtendo und Torq in einem |cFF2959D3|Hspell:465833|h[Kolossalen Zusammenstoß]|h|r aufeinander!', 59888),
(27555, 'deDE', 'Heiler', '$bullet; Bei Ablauf bricht |cFF2959D3|Hspell:424739|h[Chaotische Verderbnis]|h|r aus und springt auf den nächsten Spielercharakter über.\n$bullet;|cFF2959D3|Hspell:424739|h[Chaotische Verderbnis]|h|r fügt ihrem aktuellen Ziel moderaten regelmäßigen Schaden zu.\n$bullet;|cFF2959D3|Hspell:425052|h[Dunkle Gravitation]|h|r fügt während ihrer Dauer allen Spielercharakteren moderaten Schaden zu.', 59888),
(30489, 'deDE', 'Schadensklassen', '$bullet;|cFF2959D3|Hspell:465952|h[Bedrohlicher böser Batzen Bomben]|h|r und |cFF2959D3|Hspell:1214607|h[Bedrohlichere bösere Bombenexplosion]|h|r lösen zusätzlich |cFF2959D3|Hspell:466158|h[Pionierpäckchen]|h|r und |cFF2959D3|Hspell:1214755|h[Überladene Raketen]|h|r aus.\n$bullet;Sterbende Techniker der Düsternisverschmolzenen lassen Gigabomben fallen, die nach $1223905D einen |cFF2959D3|Hspell:1223905|h[GigaBUMM!]|h|r auslösen. Gallywix\' |cFF2959D3|Hspell:469327|h[Gigaexplosion]|h|r lässt diese sofort detonieren.\n$bullet;|cFF2959D3|Hspell:469362|h[Aufgeladene Gigabomben]|h|r, die zu einer Gigasteuerung gebracht werden, lösen eine |cFF2959D3|Hspell:469767|h[Gigabombendetonation]|h|r aus, die zu einer |cFF2959D3|Hspell:1220846|h[Steuerungsschmelze]|h|r führt, die wiederum Gallywix\' |cFF2959D3|Hspell:469286|h[Gigaspulen]|h|r unterbricht.\n$[15,16$bullet;Eine Scharfschützenwache kann mit |cFF2959D3|Hspell:466834|h[Schockbeschuss]|h|r hohen Schaden verursachen, wenn sie nicht in Schach gehalten wird.$]', 59888),
(30488, 'deDE', 'Heiler', '$bullet;Spielercharaktere, die von |cFF2959D3|Hspell:1220761|h[Kanistern des Mechingenieurs]|h|r beeinträchtigt sind, detonieren bei Verbrauch oder Ablauf und lösen eine |cFF2959D3|Hspell:474447|h[Kanisterdetonation]|h|r aus.\n$bullet;Sterbende Techniker der Düsternisverschmolzenen lassen Gigabomben fallen, die nach $1223905D einen |cFF2959D3|Hspell:1223905|h[GigaBUMM!]|h|r auslösen. Gallywix\' |cFF2959D3|Hspell:469327|h[Gigaexplosion]|h|r lässt diese sofort detonieren. \n$bullet;|cFF2959D3|Hspell:469362|h[Aufgeladene Gigabomben]|h|r, die zu einer Gigasteuerung gebracht werden, lösen eine |cFF2959D3|Hspell:469767|h[Gigabombendetonation]|h|r aus, die zu einer |cFF2959D3|Hspell:1220846|h[Steuerungsschmelze]|h|r führt, die wiederum Gallywix\' |cFF2959D3|Hspell:469286|h[Gigaspulen]|h|r unterbricht.\n$bullet;|cFF2959D3|Hspell:469286|h[Gigaspulen]|h|r, |cFF2959D3|Hspell:466338|h[Zickzacker]|h|r und |cFF2959D3|Hspell:1214369|h[TOTALE ZERSTÖRUNG!!!]|h|r verursachen erheblichen Schaden.', 59888),
(30487, 'deDE', 'Tanks', '$[15,16$bullet;|cFF2959D3|Hspell:465952|h[Bedrohlicher böser Batzen Bomben]|h|r und |cFF2959D3|Hspell:1214607|h[Bedrohlichere bösere Bombenexplosion]|h|r erschaffen zusätzlich |cFF2959D3|Hspell:466165|h[700-kg-\"Blindgänger\"]|h|r.$]\n$bullet;|cFF2959D3|Hspell:466340|h[Streuschlagkanister]|h|r und |cFF2959D3|Hspell:1214607|h[Bedrohlichere bösere Bombenexplosion]|h|r beeinträchtigen Spielercharaktere in Gallywix\' Blickrichtung.\n$bullet;Sterbende Techniker der Düsternisverschmolzenen lassen Gigabomben fallen, die nach $1223905D einen |cFF2959D3|Hspell:1223905|h[GigaBUMM!]|h|r auslösen. Gallywix\' |cFF2959D3|Hspell:469327|h[Gigaexplosion]|h|r lässt diese sofort detonieren.\n$bullet;Gallywix löst alle |cFF2959D3|Hspell:1220290|h[Trickschüsse]|h|r aus, sobald er $1220290s2 Stapel erreicht, oder wenn er das Primärziel wechselt.', 59888),
