(31173, 'deDE', 'Unterbrechung: Angedockt und geladen', 'Gallywix fällt in die Arena und setzt |cFF2959D3|Hspell:1214226|h[Kraterbildung]|h|r gegen alles ein, das ihm im Weg steht. Er erhält eine |cFF2959D3|Hspell:1214229|h[Panzerung der Armageddonklasse]|h|r und setzt dann |cFF2959D3|Hspell:1214369|h[Totale Zerstörung!!!]|h|r ein, bis er unterbrochen wird.', 59888),
