(30498, 'deDE', 'Phase 1: Was für ein Arsenal!', '\"Das eigene Abbild wird eindeutig nicht in einen Berg gehauen, wenn man sich von anderen herumschubsen lässt.\"\n\nGallywix verprügelt seine Gegner mit seinem verbesserten Arsenal.', 59888),
