(31118, 'deDE', 'Abschnitt 12', '$[!23\n\n[Mythisch] \'Chaotische Verderbnis\' belegt den Spielercharakter mit \'Chaotische Verwundbarkeit\', wenn der Effekt entfernt wird.$]', 59888),
