(27557, 'deDE', 'Abschnitt 6', '', 59888),
(31956, 'deDE', 'Schadensklassen', '$bullet;|cFF2959D3|Hspell:468846|h[Springende Funken]|h|r verfolgen Spielercharaktere und betäuben sie bei Kontakt.\n$bullet;|cFF2959D3|Hspell:465279|h[Ver-dammtes Wasser]|h|r wird bei Kontakt mit Giesels Blitzfähigkeiten unter Strom gesetzt.\n$bullet;|cFF2959D3|Hspell:465463|h[Turbolader]|h|r und |cFF2959D3|Hspell:468813|h[Gigaschock]|h|r verursachen schweren Schaden.', 59888),
(31102, 'deDE', 'Tanks', '$bullet;Rik |cFF2959D3|Hspell:466128|h[resoniert]|h|r zusätzliche Leistung zu Verstärkern in der Nähe. \n$bullet; |cFF2959D3|Hspell:464488|h[Überschall]|h|r verursacht in einem kegelförmigen Bereich Schallschaden und führt zu einem |cFF2959D3|Hspell:464518|h[Tinnitus]|h|r. Schallschaden kann nicht geblockt oder durch Rüstung reduziert werden.\n$bullet;|cFF2959D3|Hspell:466722|h[Durchbrüche]|h|r von Verstärkern schleudern Spielercharaktere in die Luft, während Rik tödliche |cFF2959D3|Hspell:467991|h[Dröhnende Abstürze]|h|r erzeugt.', 59888),
(30506, 'deDE', 'Tanks', '$bullet;|cFF2959D3|Hspell:466518|h[Flüssiggoldschlagring]|h|r verursacht vor Mug schweren Schaden und belegt getroffene Spielercharaktere mit |cFF2959D3|Hspell:467202|h[Goldener Tropfen]|h|r.\n$bullet;Der Schaden von |cFF2959D3|Hspell:469490|h[Doppelwums-Schuss]|h|r wird durch den am nächsten getroffenen Spielercharakter gemildert.', 59888),
(30486, 'deDE', 'Zusammenfassung', 'Gallywix erhält mit der Zeit Energie und aktiviert die |cFF2959D3|Hspell:469286|h[Gigaspulen]|h|r des Haus des Chroms bei maximaler Kapazität. |cFF2959D3|Hspell:469362|h[Aufgeladene Gigabomben]|h|r, die zu einer Gigasteuerung gebracht werden, lösen eine |cFF2959D3|Hspell:469767|h[Gigabombendetonation]|h|r aus. Das führt zu einer |cFF2959D3|Hspell:1220846|h[Steuerungsschmelze]|h|r, die Gallywix\' |cFF2959D3|Hspell:469286|h[Gigaspulen]|h|r stört. Nach dem Verlust beider Gigasteuerungen bildet sich eine |cFF2959D3|Hspell:1215209|h[Sabotagezone]|h|r.\n\nAußerdem ruft Gallywix während der Begegnung völlig überbezahlte Kumpanen der Düsternisverschmolzenen zu Hilfe.\n\nIm Verlauf des Kampfes verändert sich Gallywix und erweitert sein Arsenal, um manisches Chaos hervorzurufen.$[14,15,17$ Wenn Gallywix\' Gesundheit auf 50% fällt, wertet er seine Fähigkeiten auf, um die Spielercharaktere ein für alle Mal zu vernichten.$]', 59888),
(30082, 'deDE', 'Heiler', '$bullet;Wenn während |cFF2959D3|Hspell:461060|h[Drehen für den Sieg!]|h|r zwei Spielmarken nicht eingeworfen werden oder die Wiederholung einer Kombination entdeckt wird, setzt der einarmige Bandit |cFF2959D3|Hspell:461068|h[\'Betrug entdeckt!\']|h|r ein.\n$bullet;|cFF2959D3|Hspell:460164|h[\'Widerwärtiger Ausstoß\']|h|r verringert die Bewegungsgeschwindigkeit aller Spielercharaktere und absorbiert eine große Menge Heilung.\n$bullet;Stehen neben dem |cFF2959D3|Hspell:460181|h[Gewinnlinien]|h|rjeton gewährt |cFF2959D3|Hspell:460444|h[Glücksroller!]|h|r.', 59888),
(31381, 'deDE', 'Abschnitt 45', '', 59888),
(31380, 'deDE', 'Abschnitt 44', '', 59888),
(30951, 'deDE', 'Heiler', '$bullet;Tickende Zeitbomben, die vom |cFF2959D3|Hspell:460867|h[Mächtigen BadaBUMM]|h|r erzeugt wurden, fügen bei Ablauf allen Spielercharakteren schweren Schaden zu.\n$bullet;|cFF2959D3|Hspell:459779|h[Ein Unkontrollierter Ansturm]|h|r lässt Bront durch jegliches Hindernis auf seinem Weg rennen, auch durch die vom |cFF2959D3|Hspell:460867|h[Mächtigen BadaBUMM]|h|r erzeugten tickenden Zeitbomben.\n$bullet;$[8,23|cFF2959D3|Hspell:473690|h[Kinetisches explosives Gel]|h|r stößt tickende Zeitbomben in der Nähe in die Luft, wenn es entfernt wird.$]', 59888),
(30950, 'deDE', 'Tanks', '$bullet;Tickende Zeitbomben, die vom |cFF2959D3|Hspell:460867|h[Mächtigen BadaBUMM]|h|r erzeugt wurden, fügen bei Ablauf allen Spielercharakteren schweren Schaden zu.\n$bullet;|cFF2959D3|Hspell:459779|h[Ein Unkontrollierter Ansturm]|h|r lässt Bront durch jegliches Hindernis auf seinem Weg rennen, auch durch die vom |cFF2959D3|Hspell:460867|h[Mächtigen BadaBUMM]|h|r erzeugten tickenden Zeitbomben.', 59888),
(30949, 'deDE', 'Schadensklassen', '$bullet;Tickende Zeitbomben, die vom |cFF2959D3|Hspell:460867|h[Mächtigen BadaBUMM]|h|r erzeugt wurden, fügen bei Ablauf allen Spielercharakteren schweren Schaden zu.\n$bullet;|cFF2959D3|Hspell:459779|h[Ein Unkontrollierter Ansturm]|h|r lässt Bront durch jegliches Hindernis auf seinem Weg rennen, auch durch die vom |cFF2959D3|Hspell:460867|h[Mächtigen BadaBUMM]|h|r erzeugten tickenden Zeitbomben.\n$bullet;$[8,23|cFF2959D3|Hspell:473690|h[Kinetisches explosives Gel]|h|r stößt tickende Zeitbomben in der Nähe in die Luft, wenn es entfernt wird.$]', 59888),
