(31132, 'deDE', 'Schadensklassen', '$bullet;Kul\'tharok reißt mit |cFF2959D3|Hspell:473959|h[Seele entziehen]|h|r Seelen aus Spielercharakteren. Wenn die Seelen Kul\'tharok erreichen, flößt er ihnen nekrotische Energie ein, wodurch es zu |cFF2959D3|Hspell:474013|h[Seelenverderbnis]|h|r kommt.\n$bullet; |cFF2959D3|Hspell:1216474|h[Todesspirale]|h|r erzeugt eine sich drehende Nekromantenkugel, die Spielercharakteren bei Kontakt Schattenschaden zufügt.', 59888),
(28414, 'deDE', 'Zusammenfassung', 'Braumeister Aldryr macht sich die explosive Kraft von Glutbräu zu eigen und greift die Spielercharaktere mit |cFF2959D3|Hspell:432198|h[Lodernder Rülpser]|h|r und |cFF2959D3|Hspell:432182|h[Glutbräu werfen]|h|r an.\n\nBei 66% und 33% Gesundheit beginnt Braumeister Aldryr die |cFF2959D3|Hspell:442525|h[Feierstunde]|h|r, wodurch durstige Gäste einen |cFF2959D3|Hspell:431896|h[Rüpelschrei]|h|r ausstoßen.', 59888),
(22652, 'deDE', 'Schadensklassen', '$bullet;|cFF2959D3|Hspell:333292|h[Sengender Tod]|h|r fügt Verbündeten in der Nähe Schaden zu.\n$bullet;Beim Erreichen von 100 Energie greift Paceran die Spielercharaktere mit |cFF2959D3|Hspell:320182|h[Giftsporen]|h|r an.', 59888),
(22650, 'deDE', 'Tank', '$bullet;|cFF2959D3|Hspell:320069|h[Tödlicher Stoß]|h|r verringert sämtlichen erhaltenen Schaden.\n$bullet;Beim Erreichen von 100 Energie greift Paceran die Spielercharaktere mit |cFF2959D3|Hspell:320182|h[Giftsporen]|h|r an.', 59888),
