(21580, 'deDE', 'Schadensklassen', '$bullet;Wenn er besiegt wird, gewährt der gefallene Herausforderer den verbleibenden Herausforderern den |cFF2959D3|Hspell:1215747|h[Letzten Willen]|h|r.\n$bullet;|cFF2959D3|Hspell:333292|h[Sengender Tod]|h|r fügt Verbündeten in der Nähe Schaden zu.\n$bullet;Beim Erreichen von 100 Energie greift Paceran die Spielercharaktere mit |cFF2959D3|Hspell:320182|h[Giftsporen]|h|r an.', 59888),
(21579, 'deDE', 'Heiler', '$bullet;|cFF2959D3|Hspell:320069|h[Tödlicher Stoß]|h|r verringert sämtlichen erhaltenen Schaden.\n$bullet;|cFF2959D3|Hspell:333292|h[Sengender Tod]|h|r fügt Verbündeten in der Nähe Schaden zu.\n$bullet;|cFF2959D3|Hspell:1215600|h[Verwelkende Berührung]|h|r fügt betroffenen Spielercharakteren durchgehend Schattenschaden zu, bis der Effekt gebannt wird.', 59888),
(21577, 'deDE', 'Zusammenfassung', 'Besiegt alle drei Herausforderer, um Euren Wert zu beweisen. Wenn sie 100 Energie erreichen, entfesselt jeder der Herausforderer eine mächtige Fähigkeit.', 59888),
(19233, 'deDE', 'Tanks', '$bullet;Bringt den Platinprügler in Reichweite der |cFF2959D3|Hspell:282943|h[Kolbenkracher]|h|r, um Stapel der |cFF2959D3|Hspell:282801|h[Platinpanzerung]|h|r zu entfernen.', 59888);
