INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2345, 'deDE', 'Teebüschel der Meeksi', '|cFFFFD200WoW-Shop|r|n', 'Teebüschel sind für ihre aromatischen Tees bekannt, doch ihre verspielte Natur kann in jeder Menge verschüttetem Tee enden.', 59888),
(2344, 'deDE', 'Rollpfote der Meeksi', '|cFFFFD200WoW-Shop|r|n', 'Rollpfoten sind besonders stolz auf ihre Teebeförderungsdienste. Sie sind stets gewillt, ihren Reisebegleitern eine warme Tasse Tee zu servieren.', 59888),
(2343, 'deDE', 'Weichtatze der Meeksi', '|cFFFFD200WoW-Shop|r|n', 'Sanftpfoten bieten den perfekten Schwarztee, um morgens richtig in die Gänge zu kommen oder bis spät in die Nacht wach zu bleiben.', 59888),
(2342, 'deDE', 'Wuschelpelz der Meeksi', '|cFFFFD200WoW-Shop|r|n', 'Wuschelpelze sind verspielt, tollpatschig und von Sauberkeit besessen. Eine gefährliche Kombination an Wesenszügen.', 59888),
(2489, 'deDE', 'Perlmuttschmetterling', '|cFFFFD200Handelsposten|r', 'Steigt auf einem glitzernden, schimmernden, Perlmuttschmetterling hoch in die Lüfte.', 59888),
(2288, 'deDE', 'Personalisierter Goblinverschrotter', '|cFFFFD200Beute:|r Durchwühlter Schrotthaufen|n|cFFFFD200Zone:|r Lorenhall', 'Goblinschredder haben immer wieder bewiesen, in vielen verschiedenen Anwendungen nützlich zu sein, wie beim Holzfällen und Transport. Dieses Modell wurde für den Einsatz mit S.C.H.R.O.T.T. umfunktioniert.', 59888),
(2346, 'deDE', 'Gebräudieb der Meeksi', '|cFFFFD200WoW-Shop|r|n', 'Trotz ihrer schelmischen und spielerischen Art sind diese Kreaturen treue und verlässliche Reisegefährten.', 59888),
(2296, 'deDE', 'Gobtrotter des Tiefenforschers', '|cFFFFD200Weltquest: |rIch will meinen Hut zurück|n|cFFFFD200Zone: |rInsel von Dorn|n|cFFFFD200Zone: |rDornogal', 'Mit diesem Luftfahrzeug könnt Ihr Euch direkt ins Abenteuer stürzen, wenn es vorher nicht explodiert!', 59888),
(2279, 'deDE', 'Donnertrommelfehlzündung', '|cFFFFD200Händler: |rAndo die Knarre|n|cFFFFD200Zone: |rBefreiung von Lorenhall|n|cFFFFD200Kosten: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'Wurde nach einem besonders grausigen Aufeinandertreffen von der Tribüne des Kessels geborgen. Auf die Frage, ob es sich um einen Blindgänger handelt, antwortete Torqs Management mit: \"Vermutlich?\"', 59888),
(2276, 'deDE', 'Unrator der Düsternisverschmolzenen', '|cFFFFD200Händler: |rAndo die Knarre|n|cFFFFD200Zone: |rBefreiung von Lorenhall|n|cFFFFD200Kosten: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'Wird als der Schrottplatzhirsch unter Stix\' Schrottplatzhyänen betrachtet. Hat genug Beißkraft, um alles... und jeden... zu zerkleinern, den Gallywix aus dem Weg haben möchte.', 59888),
(1471, 'deDE', 'Rache', '|cFFFFD200Beute von:|r Fürstin Sylvanas Windläufer|n|cFFFFD200Zone:|r Sanktum der Herrschaft|n|cFFFFD200Schwierigkeitsgrad:|r Mythisch', 'Sylvanas verlor einen Teil ihrer selbst, als Arthas ihr das Leben nahm, und die Dunkelheit in ihr wuchs an, um die Leere auszufüllen.', 59888);
