(12933, 'deDE', 'Mug\'Zee betreibt den Sicherheitsdienst im Garbagio, Gallywix\' unüberwindbares Casino. Niemand gelangt zum Chromkönig, ohne erst an diesem mächtigen Oger vorbeizukommen.', 'Zwei Köpfe sind besser', 59888),
