(76, 'deDE', 'Neu in Patch 11.1.0!', 'F.A.H.R.E.N.', 'Erlebt mit dem 99-G-Genickbrecher in Lorenhall eine neue Art der Fortbewegung!', 'Passt Euren Lagerplatz an', 'Erstellt neue Lager im Charakterauswahlbildschirm und wählt aus einer Reihe von freischaltbaren Hintergründen aus!', 'Lorenhall', 'Führt die Verfolgung von Xal\'atath fort und stellt Euch Gallywix\' Streitkräften in den weitläufigen Straßen Lorenhalls.', 59888);
