(7, 'deDE', 'Freyholtzquelle', 'Die Irdenen von Freyholtz freuen sich, solche renommierten Abenteurer zu Gast zu haben. Aber räumt bitte hinter Euch auf.', '|cFFFFD200Erfolg:|r Khazer Zaster', 59888),
